import { FirstName } from "./Context";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";

const Child3 = () => {
    
    const fname = useContext(FirstName);
    return (
    <>
            <h1>My name is {fname}</h1>
    </>
  );
};

export default Child3;
